	(29, 19, '2024-11-28', '1.TENEMOS UN GRUPO DE ARA TOURS INGRESANDO DE 9 HABITACIONES CON 13 PAX, VIENEN EN EL VUELO AF428 QUE ATERRIZA A LAS 17:55HRS, GUIA A CARGO ES EL CABALLERO OTTO CHAVEZ\r\n2.TENEMOS UN GRUPO DE ARA TOURS INGRESANDO DE 13 HABITACIONES CON 19 PAX, VIENEN EN EL VUELO LH518 QUE ATERRIZA A LAS 13:20HRS, ESTE GRUPO SE HOSPEDARÁ 2 NOCHES.\r\n3. TENEMOS EL DIA DE HOY EL EVENTO DE THANKS GIVING  EN EL RESTAURANTE A LAS 7:00PM\r\n\r\n', '2024-11-28 12:52:11'),
